import React from 'react';
import { programmingSkills, securitySkills } from '../../data';
import '../../styles/Skills.css';

function Skills() {
  return (
    <div className="skills-container">
      <h2 className="section-title">Programming</h2>
      <div className="skill-thumbnails">
        {programmingSkills.map(skill => (
          <div key={skill.id} className="skill-thumbnail">
            <div className="thumbnail-image-s">
              <img src={skill.image} alt={skill.title} />
            </div>
            <div className="skill-details">
              <h2>{skill.title}</h2>
              <p className='xp'>{skill.xp} </p>
              <p className='level'>{skill.level} </p>
            </div>
          </div>
        ))}
      </div>

      <div className="skills-divider">
        <span></span>
      </div>

      <h2 className="section-title">Security</h2>
      <div className="skill-thumbnails">
        {securitySkills.map(skill => (
          <div key={skill.id} className="skill-thumbnail">
            <div className="thumbnail-image-s">
              <img src={skill.image} alt={skill.title} />
            </div>
            <div className="skill-details">
              <h2>{skill.title}</h2>
              <p className='xp'>{skill.xp} </p>
              <p className='level'>{skill.level} </p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Skills;
